import React from 'react';

const Activity = ({ activity, onCheck }) => {
    const handleCheckChange = (e) => {
        onCheck(activity['si.no'], e.target.checked);
    };

    return (
        <tr>
            <td>{activity.hrs}</td>
            <td>{activity.mins}</td>
            <td>{activity.sec}</td>
            <td>{activity['si.no']}</td>
            <td className="activity-name" data-fullname={activity.activity_name}>{activity.activity_name}</td>
            <td>{activity.confirmed_by}</td>
            <td>
                <input
                    type="checkbox"
                    checked={activity.isChecked}
                    onChange={handleCheckChange}
                />
            </td>
        </tr>
    );
};

export default Activity;
